import React from 'react';

function Nav() {


    return(
    <header>
        <h1> <a href="/"> RUN BUDDY </a> </h1>
            <nav>
                <ul>
                    <li> <a href="#what-we-do">What We Do</a> </li>
                    <li> <a href="#what-you-do">What You Do</a> </li>
                    <li> <a href="#your-trainers">Your Trainers</a> </li>
                    <li> <a href="#reach-out">Reach Out</a> </li>
            </ul>
        </nav>
    </header>
    );
}



export default Nav;
